import React from 'react';


 class PropertyCard extends React.Component{
 
    constructor(){
        super(props);
        this.state={
            name:'',
        }
    }
    render(){
        return(
           
            <div>
                <div>
                    <label>label:</label>
                    <input 
                        type="text"
                        value={this.state.name } 
                        onChange={(e)=>this.setState({name:e.target.value})}
                    />
 
                </div>
            </div>

        );
    }
}


export default PropertyCard;
